import Foundation

extension AdventOfCode2018 {
    struct Day5 {
        static func resolveReactions<T: StringProtocol>(for polymers: T) -> String {
            var remaining = String(polymers)
            guard remaining.count > 1 else { return remaining }

            var c1i = remaining.startIndex
            var c2i = remaining.index(after: c1i)
            var reacted = Set<String.Index>()
            var remainingLength = remaining.count
            while c2i < remaining.endIndex && remainingLength > 1 {
                let c1 = remaining[c1i]
                let c2 = remaining[c2i]

                if c1.reactsWith(c2) {
                    reacted.insert(c1i)
                    reacted.insert(c2i)
                    remainingLength -= 2
                    while c1i > remaining.startIndex && reacted.contains(c1i) {
                        c1i = remaining.index(before: c1i)
                    }

                    if c1i == remaining.startIndex && reacted.contains(c1i) {
                        c1i = remaining.index(after: c2i)
                        if c1i < remaining.endIndex {
                            c2i = remaining.index(after: c1i)
                        }
                    } else {
                        if c2i < remaining.endIndex {
                            c2i = remaining.index(after: c2i)
                        } else {
                            break
                        }
                    }
                } else {
                    c1i = c2i
                    c2i = remaining.index(after: c1i)
                }
            }
            reacted.sorted().reversed().forEach({ remaining.remove(at: $0) })
            
            return remaining
        }
        
        static func part1(inputs: String = rawInput) -> Int {
            return resolveReactions(for: inputs).count
        }
    }
}

private extension Character {
    func reactsWith(_ other: Character) -> Bool {
        guard self != other else { return false }
        return String(self).lowercased() == String(other).lowercased()
    }
}

extension AdventOfCode2018.Day5 {
    static let rawInput: String = """

"""
}
